import { Component } from 'react';
import './Pager.css';

class Pager extends Component {
  render() {
    return (
      <div className="pagers">
        <a href="#">&laquo;</a>
        <a href=".">1</a>
        <a href=".">2</a>
        <a href=".">3</a>
        <a href=".">4</a>
        <a href=".">5</a>
        <a href=".">6</a>
        <a href="#">&raquo;</a>
      </div>
    );
  }
}

export default Pager;
